import { Card } from "antd";
import React from "react";
import './Screen.scss'


export default function Screendefault({children}, props) {
    const { id } = props;
    return (
        <div className="screen" id={id}>
            <Card title="" className="cardDefault" headStyle={{ textAlign : "center"}} >
                {children}
            </Card>
        </div>
    )
}
